  input: 'TEXT,F3XA,,"In response to your letter dated Dec. 8, 2006, please be advised
    that (1) the payments for palmcards, postage and printing are for exempt party
    activities.  We believe the materials qualify as exempt activities because (a)
    they were Party activities related to the Party''s general election nominees,
    (b) the printed materials were distributed by volunteers; for items that were
    mailed, volunteers prepared the mail and stamped each piece, and no commercial
    lists were used, (c) the Party did not use any national committee funds or transfers,  or
    funds designated for a particular candidate, and (d) the costs were paid entirely
    with permissible funds.   (2) the payment for ''sponsorship of event'' was for
    the Party''s regular activities and not on behalf of any candidate.                    As
    reported earlier: Memo entries have been made for travel expense reimbursements,
    where a vendor has been paid at least $200 in the aggregate.  The remainder of
    such reimbursements are primarily for mileage."'
